	this.drawDisc2 = function (x, y)
	{
		var rad = 500;
		ctx.beginPath();
		ctx.arc(x,y,rad,0,2*Math.PI);
		ctx.fillStyle = "white";
		ctx.fill();
		ctx.strokeStyle = "black";
		for(var i = 0; i < rad / (ctx.lineWidth *2); i++)
		{		
			ctx.beginPath();
			ctx.arc(x, y, (ctx.lineWidth *2) * (i + 1), 0, Math.PI*2);
			ctx.stroke();
		}
	}

	this.drawLine = function(first, second, color)
	{
		ctx.strokeStyle = color;
		ctx.beginPath();
		ctx.moveTo(first.x, first.y);
		ctx.lineTo(second.x, second.y);
		ctx.stroke();
	}
